import React from "react";

const DisplayBlog = (name, city, blog) => {
    return (
        <div >
            <div>Name = {name}</div>
            <div>City = {city}</div>
            <div>Blog = {blog}</div>
        </div>
    )
}

export default DisplayBlog;
